Notas adicionales: Marcelo Hilario del Pilar y Gatmaitán (1850-1896) fue un escritor y periodista filipino, figura importante del movimiento de reforma en Filipinas durante el período colonial español. "Laong-Laan" era uno de los seudónimos utilizados por José Rizal, a quien este poema está dedicado.
